import React, { useContext } from 'react';
import JobContext from '../../context/Jobs/jobsContext'; // Correct import path

const Jobs = () => {
  const { jobs } = useContext(JobContext); // Get jobs from context

  return (
    <div>
      <h1>Available Jobs</h1>
      {jobs && jobs.map((job) => ( 
        <div key={job._id}>
          <h3>{job.jobTitle}</h3>
          <p>{job.jobDescription}</p>
          <p>Company: {job.jobCompany}</p>
          <p>Salary: ${job.jobSalary}</p>
        </div>
      ))}
    </div>
  );
};

export default Jobs;
